import React, { Component } from 'react';

const DownIcon = props => {
  return (
    <div
      onClick={props.onClick}
      style={{
        display: "flex",
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "center",
        marginBattom: "-34px",
        transform: "translateY(-45px)"
      }}
    >
      <div
       style={{
        maxWidth: "30px"
      }}>
        <img
          src={props.icon}
         
        />
      </div>
    </div>
  );
};

export default DownIcon;
